void
test_ecc()
{
  uint32_t i;

  uint32_t order[8] = { 0xFC632551, 0xF3B9CAC2, 0xA7179E84, 0xBCE6FAAD, 0xFFFFFFFF, 0xFFFFFFFF, 0x00000000, 0xFFFFFFFF };
  for(i = 0; i < 3; i++) {
    printf("ECC valid key test %d/3 - %s\n", i + 1, (ecc_is_valid_key(ecc_keys[i], order) == ecc_keys[i][8] ? "Succeed" : "        Failed"));
  }

  uint32_t base_x[8] = { 0xd898c296, 0xf4a13945, 0x2deb33a0, 0x77037d81, 0x63a440f2, 0xf8bce6e5, 0xe12c4247, 0x6b17d1f2 };
  uint32_t base_y[8] = { 0x37bf51f5, 0xcbb64068, 0x6b315ece, 0x2bce3357, 0x7c0f9e16, 0x8ee7eb4a, 0xfe1a7f9b, 0x4fe342e2 };
  uint32_t test_x[8];
  uint32_t test_y[8];
  for(i = 0; i < 32; i++) {
    uint32_t time;
    uint32_t checkvar;

    printf("Starting ECC test %d/221:\n", i + 1);

    time = *MACA_CLK;
    ecc_ec_mult(test_x, test_y, base_x, base_y, ecc_data[i][SEC1]);
    time = *MACA_CLK - time;
    checkvar = 0;
    checkvar += memcmp(ecc_data[i][PUB1_X], test_x, 32);
    checkvar += memcmp(ecc_data[i][PUB1_Y], test_y, 32);
    printf("    1/4 finished after % 4u ms - %s\n", time / 250, (checkvar ? "        Failed" : "Succeed"));

    time = *MACA_CLK;
    ecc_ec_mult(test_x, test_y, ecc_data[i][PUB1_X], ecc_data[i][PUB1_Y], ecc_data[i][SEC2]);
    time = *MACA_CLK - time;
    checkvar = 0;
    checkvar += memcmp(ecc_data[i][SHARED], test_x, 32);
    printf("    2/4 finished after % 4u ms - %s\n", time / 250, (checkvar ? "        Failed" : "Succeed"));

    time = *MACA_CLK;
    ecc_ec_mult(test_x, test_y, base_x, base_y, ecc_data[i][SEC2]);
    time = *MACA_CLK - time;
    checkvar = 0;
    checkvar += memcmp(ecc_data[i][PUB2_X], test_x, 32);
    checkvar += memcmp(ecc_data[i][PUB2_Y], test_y, 32);
    printf("    3/4 finished after % 4u ms - %s\n", time / 250, (checkvar ? "        Failed" : "Succeed"));

    time = *MACA_CLK;
    ecc_ec_mult(test_x, test_y, ecc_data[i][PUB2_X], ecc_data[i][PUB2_Y], ecc_data[i][SEC1]);
    time = *MACA_CLK - time;
    checkvar = 0;
    checkvar += memcmp(ecc_data[i][SHARED], test_x, 32);
    printf("    4/4 finished after % 4u ms - %s\n", time / 250, (checkvar ? "        Failed" : "Succeed"));
  }
}
